import React from 'react'
import {Card} from 'react-bootstrap'

const Product = ({product}) => {
  return (
    <Card>

        <a href={` /product/${product._id}`}>

        
        <img class="rounded-circle shadow-4-strong" alt="avatar2" src={product.image} />

        </a>

    </Card>
  )
}

export default Product
